import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState({ message: '', data: [] });

  useEffect(() => {
    axios.get('http://localhost:5000')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <h1>{data.message}</h1>
      <ul>
        {data.data.map(item => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
